import styled from 'styled-components';
import image from './profile.png';

export const LogoStyle = styled.img`
    width: 320px;
    height: 320px;
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
`;

const Logo = () => {
  return (

    <div className="flex justify-end flex-initial w-80 h-80 self-end">
      <LogoStyle style = {{  backgroundImage: `url(${image})`  }}/>

    </div>

  );
};

export default Logo;
